import ReactDOM from 'react-dom' 


const App = () => {

    const [good, setGood] = useState([3,5,6,4])


    const handleGoodbutton=()=>{

      setGood( good.reduce((accu,curr)=>accu+curr ,2)   )
    }


return (
      <div>

      <button onClick={handleGoodbutton} >good</button>


      <p>good {good.length}</p>

      </div>
  )
}

ReactDOM.render(<App />, 
  document.getElementById('root')
)
